SB 3.0\",\"description\":\"Seagate Backup Plus Slim 2TB Portable Hard Drive External USB 3.0\",\"keywords\":\"Seagate Backup Plus Slim 2TB Portable Hard Drive External USB 3.0\"}\',63),(14,22,11,1546873422,\'VNA981E1\',\'Фотоаппарат Nikon Coolpix A10 Black\',\'<h2>Обзор</h2>\r\n\r\n<div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(57, 57, 57); font-family: helveticaneue, Arial, sans-serif;\">\r\n<p>Фотоаппарат модели Nikon Coolpix A10 - новая модель цифрового девайса поможет получать фотографии замечательного качества за считанные минуты. Сильная, многофункциональная внутренняя начинка позволит даже при неблагоприятной погоде получать снимки высочайшего уровня. Хороший выбор как для начинающего, так и для профессионального фотографа. Имеется широкий перечень возможностей, который сможет удовлетворить требования подавляющего большинства покупателей.</p>\r\n\r\n<p>Фотоаппарат модели Nikon Coolpix A10 оснащается стильным и приятным глазу дизайном, который будет приносит наслаждение при каждом использовании. Продуманная эргономика корпуса делает эксплуатацию устройства удобным и комфортным. Все изготовлено и расположено так, чтобы пользоваться устройством можно было как двумя, так и одной рукой, не беспокоясь о том, что фотоаппарат может выскользнуть из рук. При производстве использовались только качественные материалы, которые не оставляют отпечатков пальцев и мелких царапин на корпусе.</p>\r\n\r\n<p style=\"text-align:center\"><a href=\"http://static.cshop.local/cache/products/14/catalog_origin_68.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent; color: rgb(23, 59, 134);\" target=\"_blank\"><img alt=\"Nikon Camera Image\" src=\"http://static.cshop.local/cache/products/14/catalog_origin_68.jpg\" style=\"background:transparent; border-style:initial; border-width:0px; height:450px; margin:50px; max-width:90%; outline:0px; padding:0px; width:600px\" /></a></p>\r\n\r\n<p>Для получения красивых и сочных фотографий устройство комплектуется матрицей на 16.1 млн. пкс. 1/2,3 &#39;&#39;. Запись видео осуществляется с разрешением 1280x720, 25 кадр/с. На лицевой стороне установлен ЖК дисплей с различными кнопками управления. Их не так много, только все самое необходимое для работы. Сам ход клавиш четкий, плавный, не вызывающий ощущения неполного нажатия. Все управление будет интуитивно понятно даже неопытному владельцу. Так же немаловажной особенностью данной модели являются ее размеры. За счет миниатюрного размера у вас не возникнет трудностей с транспортировкой фотоаппарата. Точные габариты составляют - 96.4 мм х 59.4 мм х 28.9 мм. Комплект поставки самый обычный, в него входит фотоаппарат представленной модели, элементы питания, USB-кабель, ремешок, документация.</p>\r\n</div>\r\n\',300,149,1,5100,4950,NULL,\'{\"title\":\"Mirrorless Camera Nikon Coolpix A10\",\"description\":\"Mirrorless Camera Nikon Coolpix A10\",\"keywords\":\"Mirrorless Camera Nikon Coolpix A10\"}\',68),(15,6,3,1547313899,\'0669261\',\'Ноутбук HP Pavilion x360 14-cd0014ur 4HE29EA\',\'<p><span style=\"font-size:16px\"><span style=\"font-size:14px\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"color:rgb(0, 0, 0)\">i7-8550U(1.8)/12Gb/1TB+128Gb SSD/14.0&quot; FHD IPS touch/NV GT MX130 4GB/Cam HD/FPR/Win10 +Pen(Mineral Silver) - Transformer</span></span></span></span></p>\r\n\',1680,99,1,80000,79290,NULL,\'{\"title\":\"Ноутбук HP Pavilion\",\"description\":\"Ноутбук HP Pavilion x360 14-cd0014ur 4HE29EA\",\"keywords\":\"Ноутбук HP Pavilion\"}\',73);'
